I finished the last page of my sketchbook last night. I‚Äôve had this book for over two years, and I have a lot of memories with it, and I want to show just a few with you.
1: the book, the pencil I use, and the bookmark.
2: page 10, my first experiment with alcohol markers, feat. an outdated version of my character Ell. 8-6-18
3: p. 18, an environment study of the view from my grandparents‚Äô porch in Oklahoma. 9-2
4: p. 96, character design sketches for a gothic architecture golem, Tympanum. They‚Äôre very complicated. 4-15-19
5: p. 115, a sketch of Eunice from animal crossing. I drew a few AC characters, but this one was my favorite. 6-23
6: p. 131, a hanging pot of flowers in the shape of a brain. Inspired by real plants I saw while visiting a college campus. 7-27
7: p. 143, sketch of Spinel from the Steven Universe movie. I like her design and her first song. A rare instance of me actually drawing eyes that aren‚Äôt just lines. 9-10
8: p. 193, small sketches of anime characters. Deku, Madoka, and Kanamori. 2-8-20
9: p. 202, my angel character, Eieiael. I‚Äôll probably tell you more soonish. 4-6
10: p. 207, an updated Ell, with notes on traits for my mermaid characters. 5-7
